script: |
  super -f text -I q11017.spq | sort > q11017.out

inputs:
  - name: q11017.spq
    data: |
      SELECT DISTINCT + col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( col0 ) NOT IN ( col0, + 42 * col1 / 7 * - 3 - - col0 + - col1 + - col2, + + col1 * + 51 * - + 1 );
  - name: tab1

outputs:
  - name: q11017.out
    data: |
